import './App.css';
import React from 'react';
import { Swappable } from '@shopify/draggable';

function App() {

  const swappable = new Swappable(document.querySelectorAll('ul'), {
    draggable: 'li',
    classes: {
      'draggable:over': ['draggable--over', 'bg-red-200', 'bg-opacity-25'],
    },
  });

  swappable.on('swappable:start', () => console.log('swappable:start'));
  swappable.on('swappable:swapped', () => console.log('swappable:swapped'));
  swappable.on('swappable:stop', () => console.log('swappable:stop')); 

  console.log(swappable);
  return (
    <div>
      <div style={{ border: 'solid', borderWidth: '0.1px' }}>
        <ul className='li'> hi </ul>
        <ul className='li'> bye</ul>
      </div>
      <header className='header'>
        <p>Hi</p>
      </header>
      <section className='home'>
      </section>
      <section className='about'>
        <h2 className='section-heading'>
          About
        </h2>
      </section>
      <section className='projects'>
        <h2 className='section-heading'>
          Projects
        </h2>
      </section>
      <section className='contact'>
        <h2 className='section-heading'>
          Contact
        </h2>
      </section>
      <footer>

      </footer>
    </div>
  );
}

export default App;
